import React from 'react';
import './Nav.css';
const Nav = (props) => {
    return (
        <nav className="nav">
            <ul className="nav_ul">
                <li><a>Logo</a></li>
                <li className="nav-lgsn"><a>Blogs</a></li>
                <li className="nav-lgsn"><a>Login</a></li>
                <li className="nav-lgsn"><a>Signup</a></li>
            </ul>
        </nav>
    );
}

export default Nav;
